define('Box2DDebugDraw',[
  'Box2D',
  'Box2DHelpers'
], function(
  Box2D,
  helpers
){
  var context, tmpI;

  var b2Color = Box2D.b2Color;
  var b2Vec2 = Box2D.b2Vec2;
  var b2Transform = Box2D.b2Transform;

  var copyVec2 = helpers.copyVec2;
  var scaledVec2 = helpers.copyVec2;

  function drawAxes(ctx) {
      ctx.strokeStyle = 'rgb(192,0,0)';
      ctx.beginPath();
      ctx.moveTo(0, 0);
      ctx.lineTo(1, 0);
      ctx.stroke();
      ctx.strokeStyle = 'rgb(0,192,0)';
      ctx.beginPath();
      ctx.moveTo(0, 0);
      ctx.lineTo(0, 1);
      ctx.stroke();
  }

  function setColorFromDebugDrawCallback(color) {
      var col = Box2D.wrapPointer(color, b2Color);
      var red = (col.get_r() * 255)|0;
      var green = (col.get_g() * 255)|0;
      var blue = (col.get_b() * 255)|0;
      var colStr = red+","+green+","+blue;
      context.fillStyle = "rgba("+colStr+",0.5)";
      context.strokeStyle = "rgb("+colStr+")";
  }

  function drawSegment(vert1, vert2) {
      var vert1V = Box2D.wrapPointer(vert1, b2Vec2);
      var vert2V = Box2D.wrapPointer(vert2, b2Vec2);
      context.beginPath();
      context.moveTo(vert1V.get_x(),vert1V.get_y());
      context.lineTo(vert2V.get_x(),vert2V.get_y());
      context.stroke();
  }

  function drawPolygon(vertices, vertexCount, fill) {
      context.beginPath();
      for(tmpI = 0; tmpI < vertexCount; tmpI++) {
          var vert = Box2D.wrapPointer(vertices+(tmpI * 8), b2Vec2);
          if (! tmpI) context.moveTo(vert.get_x(),vert.get_y());
          else context.lineTo(vert.get_x(),vert.get_y());
      }
      context.closePath();

      if (fill) context.fill();
      context.stroke();
  }

  function drawCircle(center, radius, axis, fill) {
      var centerV = Box2D.wrapPointer(center, b2Vec2);
      var axisV = Box2D.wrapPointer(axis, b2Vec2);

      context.beginPath();
      context.arc(centerV.get_x(),centerV.get_y(), radius, 0, 2 * Math.PI, false);
      if (fill)

      if (fill) {
        context.fill();
        context.stroke();

        //render axis marker
        var vert2V = copyVec2(centerV);
        vert2V.op_add( scaledVec2(axisV, radius) );
        context.beginPath();
        context.moveTo(centerV.get_x(),centerV.get_y());
        context.lineTo(vert2V.get_x(),vert2V.get_y());
        context.stroke();
      } else context.stroke();
  }

  function drawTransform(transform) {
      var trans = Box2D.wrapPointer(transform,b2Transform);
      var pos = trans.get_p();
      var rot = trans.get_q();

      context.save();
      context.translate(pos.get_x(), pos.get_y());
      context.scale(0.5,0.5);
      context.rotate(rot.GetAngle());
      context.lineWidth *= 2;
      drawAxes(context);
      context.restore();
  }

  function getCanvasDebugDraw() {
      var debugDraw = new Box2D.JSDraw();

      // Empty implementations for unused methods.
      debugDraw.DrawPolygon = drawPolygon;
      debugDraw.DrawSolidPolygon = drawPolygon;
      debugDraw.DrawCircle = drawCircle;
      debugDraw.DrawSolidCircle = drawCircle;
      debugDraw.DrawTransform = drawTransform;

      debugDraw.DrawSegment = function(vert1Ptr, vert2Ptr, colorPtr ) {
          setColorFromDebugDrawCallback( colorPtr );
          drawSegment( vert1Ptr, vert2Ptr );
      };

      return debugDraw;
  }

  return {
    getCanvasDebugDraw: function(canvasContext) {
      context = canvasContext;
      return getCanvasDebugDraw();
    }
  };

});

define('draw',[
  'THREE',
  'Box2DDebugDraw',
  'Box2DHelpers'
], function(
  THREE,
  Box2DDebugDraw,
  Box2DHelpers
){
  var debugCanvas, debugContext;
  var canvasWidth, canvasHeight;
  var canvasOffsetX, canvasOffsetY;
  var PTM = 32;

  var initDebugDraw = function(b2world){
    debugCanvas = document.createElement('canvas');
    document.body.appendChild(debugCanvas);
    debugContext = debugCanvas.getContext('2d');
    var debugDraw = Box2DDebugDraw.getCanvasDebugDraw(debugContext);
    var flags = 0;
    flags |= Box2DHelpers.e_shapeBit;
    flags |= Box2DHelpers.e_jointBit;
    // flags |= Box2DHelpers.e_aabbBit;
    flags |= Box2DHelpers.e_centerOfMassBit;
    debugDraw.SetFlags( flags );
    b2world.SetDebugDraw( debugDraw );
  };

  return {
    init: function(options){
      this.scene = new THREE.Scene();
      this.renderer = new THREE.WebGLRenderer();
      document.body.appendChild(this.renderer.domElement);

      initDebugDraw(options.b2world);
    },

    resize: function(){
      this.renderer.setSize(window.innerWidth, window.innerHeight);
      canvasWidth = window.innerWidth;
      canvasHeight = window.innerHeight;
      debugCanvas.width = canvasWidth;
      debugCanvas.height = canvasHeight;
      canvasOffsetX = window.innerWidth / 2;
      canvasOffsetY = window.innerHeight;
    },

    draw: function(scene, camera){
      this.renderer.domElement.style.display = 'block';
      this.renderer.render(scene, camera);
    },

    clear: function(){
      this.renderer.domElement.style.display = 'none';
    },

    clearDebugDraw: function(){
      debugContext.clearRect(0,0,canvasWidth, canvasHeight);
    },

    debugDraw: function (b2world) {
      debugContext.clearRect(0,0,canvasWidth, canvasHeight);

      debugContext.save();

      debugContext.translate(canvasOffsetX, canvasOffsetY);
      debugContext.scale(1, -1);
      debugContext.scale(PTM,PTM);
      debugContext.lineWidth /= PTM;
      debugContext.fillStyle = 'rgb(255,255,0)';
      b2world.DrawDebugData();

      debugContext.restore();
    }
  };

});

define('../../lib/controls',[
  'underscore'
], function(
  _
){

  var onKeyDown = function(e){
    this.keys[e.keyCode] = true;
  };

  var onKeyUp = function(e){
    this.keys[e.keyCode] = false;
  };

  var keyboard = {
    keys: [],

    init: function(){
      this.onKeyDown = _.bind(onKeyDown, this);
      this.onKeyUp = _.bind(onKeyUp, this);
    },

    startLinstening: function(){
      document.body.addEventListener('keydown', this.onKeyDown);
      document.body.addEventListener('keyup', this.onKeyUp);
    },

    stopListening: function(){
      document.body.removeEventListener('keydown', this.onKeyDown);
      document.body.removeEventListener('keyup', this.onKeyUp);
    },

    clear: function(){
      this.keys = [];
    },

    isDown: function(n){
      return this.keys[typeof n === 'string' ? n.charCodeAt(0) : n];
    },

    isDownFast: function(n){ return this.keys[n]; }
  };

  return {
    UP: 38,
    DOWN: 40,
    LEFT: 37,
    RIGHT: 39,
    init: function(){ keyboard.init(); },
    start: function(){ keyboard.startLinstening(); },
    stop: function(){ keyboard.stopListening(); },
    isDown: function(n){ return keyboard.isDownFast(n); }
  };
});

define('interaction',[
  '../../lib/controls',
  'Box2D'
], function(
  controls,
  Box2D
){
  var b2Vec2 = Box2D.b2Vec2;

  var MAX_SPEED = 1;

  var forward = new b2Vec2(500, 0);
  var backward = new b2Vec2(-500, 0);
  var up = new b2Vec2(0, 25);

  var move = function(b2body, force){
    var v = b2body.GetLinearVelocity();

    b2body.SetAwake(true);
    b2body.ApplyForce(force, b2body.GetWorldCenter());
    v = b2body.GetLinearVelocity();
    // if (Math.abs(v.get_x()) >= MAX_SPEED) b2body.SetLinearVelocity(new b2Vec2(MAX_SPEED, v.get_y()));
    if (Math.abs(v.get_x()) >= MAX_SPEED) b2body.SetLinearVelocity(new b2Vec2(force.get_x() < 0 ? -MAX_SPEED : MAX_SPEED, v.get_y()));
  };

  var jump = function(b2body, force){
    var v = b2body.GetLinearVelocity();
    if (Math.abs(v.get_y()) <=  0.01){
      b2body.SetAwake(true);
      b2body.ApplyLinearImpulse(force, b2body.GetWorldCenter());
    }
  };

  return {
    init: function(options){
      this.world = options.b2world;
      this.dudeBody = options.dude.body;

      controls.init();
    },

    check: function(){
      if (controls.isDown(39)) move(this.dudeBody, forward);
      if (controls.isDown(38)) jump(this.dudeBody, up);
      // if (controls.isDown(40)) move(this.dudeBody, backward);
      if (controls.isDown(37)) move(this.dudeBody, backward);
    },

    start: controls.start,
    stop: controls.stop
  };
});

define('contact-listener',[
  'underscore',
  'Box2D'
], function(
  _,
  Box2D
){
  var b2Contact = Box2D.b2Contact;

  var is = function(body, name){ return body.userData && body.userData.name === name; };
  return function (){
    this.init = function(){
      var listener = new Box2D.JSContactListener();

      listener.BeginContact = function (contactPtr) {
        var contact = Box2D.wrapPointer( contactPtr, b2Contact),
          fA = contact.GetFixtureA(),
          fB = contact.GetFixtureB(),
          bA = fA.GetBody(),
          bB = fB.GetBody();

        if (is(bA, 'star')){
          // only other moving currently is the dude
          // -> collisions happen only with the dude.
          bA.userData.isAchieved = true;
          bB.userData.starred = true;
        } else if (is(bB, 'star')){
          bB.userData.isAchieved = true;
          bA.userData.starred = true;
        } else if (is(bA, 'dude')){
          bA.userData.jumping = false;
        } else if (is(bB, 'dude')){
          bB.userData.jumping = false;
        }
      };

      listener.EndContact = function(contactPtr) {
        var contact = Box2D.wrapPointer( contactPtr, b2Contact),
          fA = contact.GetFixtureA(),
          fB = contact.GetFixtureB(),
          bA = fA.GetBody(),
          bB = fB.GetBody();

        if (is(bA, 'dude')){
          bA.userData.jumping = true;
        } else if (is(bB, 'dude')){
          bB.userData.jumping = true;
        }
      };
      listener.PreSolve = function() {};
      listener.PostSolve = function() {};

      this.listener = listener;
    };
  };
});

define('world',[
  'underscore',
  'Box2D',
  'camera',
  'light',
  'ground',
  'dude',
  'platform',
  'star',
  'draw',
  'interaction',
  'config',
  'contact-listener'
], function(
  _,
  Box2D,
  Camera,
  Light,
  Ground,
  Dude,
  Platform,
  Star,
  draw,
  interaction,
  config,
  ContactListener
){
  var options;
  var b2world;
  var scene, renderer, camera;
  var b2Vec2 = Box2D.b2Vec2;
  var currentTime, prevTime;
  var dude, ground, light, star;

  return {
    init: function(){
      b2world = this.b2world = new Box2D.b2World( new b2Vec2(0.0, config.gravity));

      draw.init({b2world: b2world});
      renderer = draw.renderer;
      scene = draw.scene;

      options = {
        world: b2world,
        scene: draw.scene
      };

      light = new Light();
      // (new Light()).init(_.extend(options, {x: 5, y: -5, z: 0}));
      (new Light()).init(_.extend(options, {x: 0, y: 15, z: 5}));
      // (new Light()).init(_.extend(options, {x: 15, y: -15, z: 0}));
      camera = new Camera();
      ground = new Ground();
      dude = new Dude();
      star = new Star();

      (new Platform()).init(_.extend(options, {x: 5, y: 2}));
      (new Platform()).init(_.extend(options, {x: -3, y: 4}));
      (new Platform()).init(_.extend(options, {x: -5, y: 6}));
      (new Platform()).init(_.extend(options, {x: 4, y: 8}));

      light.init(options);
      camera.init(options);
      ground.init(options);
      dude.init(options);
      // star.init(_.extend(options, {x: 0, y: 2}));
      star.init(_.extend(options, {x: 3, y: 14}));

      interaction.init({b2world: b2world, dude: dude});
      interaction.start();

      prevTime = Date.now();

      var contactListener = new ContactListener();
      contactListener.init();
      b2world.SetContactListener(contactListener.listener);
    },

    update: function(){
      currentTime = Date.now();
      b2world.Step((currentTime - prevTime) / 1000, 3, 2);
      prevTime = currentTime;

      interaction.check();

      dude.update();
      if (star && ! star.isDestroyed()) {
        if (star.isAchieved()) {
          this.starDust = star.starDust;
          star.destroy();
          this.isGameOver = true;
          this.gameOverTime = Date.now();
        }

        star.update();
      } else {
        if (Date.now() - this.gameOverTime < 2000) this.starDust.update();
        else this.starDust.destroy();
      }

      // has dude fallen
      if (dude.body.GetPosition().get_y() <= -20){
        dude.destroy();
        dude = new Dude();
        dude.init(options);
      }

      camera.lookTowards(dude.threeObject.position);
      camera.moveX(dude.threeObject.position.x);
    },

    resize: function(){
      draw.resize();
      camera.resize();
    },

    draw: function(){
      if (! this.doDebugDraw){
        draw.draw(scene, camera.threeObject);
      } else {
        draw.clear();
      }

      if (this.previousDoDebugDraw !== this.doDebugDraw){
        draw.clearDebugDraw();
      }
      if (this.doDebugDraw) draw.debugDraw(b2world);
      this.previousDoDebugDraw = this.previousDoDebugDraw;
    }
  };
});

define('../../lib/animation-frame',[],function(){
  var lastTime = 0;
  var vendors = ['ms', 'moz', 'webkit', 'o'];

  for (var x = 0; x < vendors.length && !window.requestAnimationFrame; ++x){
      window.requestAnimationFrame = window[vendors[x]+'RequestAnimationFrame'];
      window.cancelAnimationFrame = window[vendors[x]+'CancelAnimationFrame']
        || window[vendors[x]+'CancelRequestAnimationFrame'];
  }

  if (! window.requestAnimationFrame){
    var currTime, timeToCall, id, fn,
      passTime = function(){ fn(currTime + timeToCall); };

    window.requestAnimationFrame = function(callback){
      fn = callback;
      currTime = Date.now();
      timeToCall = Math.max(0, 16 - (currTime - lastTime));
      id = window.setTimeout(passTime, timeToCall);
      lastTime = currTime + timeToCall;
      return id;
    };
  }

  if (! window.cancelAnimationFrame){
    window.cancelAnimationFrame = function(id){
      clearTimeout(id);
    };
  }

  return window.requestAnimationFrame;
});

